import React from "react";
import "./navbar.scss";

function Navbar() {
  return (
    <div className="navbar">
      <div className="wrapper">
        <div className="left">
          <a href="#contact" className="logo">
            SINTHA.
          </a>
        </div>
        <div className="right">right navbar</div>
      </div>
    </div>
  );
}

export default Navbar;
